import React, { Component } from "react";
import headshot from "../photos/ColorHeadshot.png";

class AboutTitle extends Component {
  state = {};
  render() {
    return (
      <div
        style={{
          display: "grid",
          gridTemplateRows: "0px",
          justifyContent: "center",
        }}
      >
        <div
          style={{
            maxWidth: 400,
            height: 200,
            width: "auto",
            backgroundColor: "black",

            backgroundColor: "rgb(181, 119, 0)",
          }}
        ></div>
        <div
          style={{
            maxWidth: 400,
            height: 200,
            width: "auto",
            backgroundColor: "rgb(255, 203, 105)",
            margin: 10,
            fontFamily: "Unna",
            fontSize: 70,
            fontWeight: "bold",
            display: "grid",
            alignContent: "center",
            justifyContent: "center",
          }}
        >
          <div style={{}}>
            <div style={{ alignContent: "center" }}>Vivan</div>
            <div style={{ alignContent: "center" }}>Marwaha</div>
          </div>
        </div>
        <img
          src={headshot}
          alt="Vivan"
          style={{
            maxWidth: 400,
            width: "auto",
          }}
        />
      </div>
    );
  }
}

export default AboutTitle;
